import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import AdminPicksPage from "./components/AdminPicksPage";
import AdminUploadTool from "./components/AdminUploadTool";
import AdminWinnersPage from "./components/AdminWinnersPage";
import PlayerPicksPage from "./components/PlayerPicksPage";
import PrintableGamesPage from "./components/PrintableGamesPage";
import ResultsPage from "./components/ResultsPage";
import ScoredPicksPage from "./components/ScoredPicksPage";
import ViewPicksPage from "./components/ViewPicksPage";
import ViewScoresPage from "./components/ViewScoresPage";
import WeekSelector from "./components/WeekSelector"; // Keep if needed

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<PlayerPicksPage />} />
        <Route path="/admin" element={<AdminPicksPage />} />
        <Route path="/upload" element={<AdminUploadTool />} />
        <Route path="/winners" element={<AdminWinnersPage />} />
        <Route path="/print/week/:weekId" element={<PrintableGamesPage />} />
        <Route path="/scores" element={<ScoredPicksPage />} />
        <Route path="/picks/week/:weekId" element={<PlayerPicksPage />} />
        <Route path="/view" element={<ViewPicksPage />} />
        <Route path="/view-scores" element={<ViewScoresPage />} />
        <Route path="/results" element={<ResultsPage />} />
      </Routes>
    </Router>
  );
}

export default App;
